/**
 *Submitted for verification at Etherscan.io on 2018-10-22
 */

pragma solidity ^0.8.16;

import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

interface IDatabase {
    function getAddressBook()
        external
        view
        returns (address payable[] calldata);

    function shares() external view returns (uint8[] calldata);

    function totalShares() external view returns (uint);
}

contract SpreadLove {
    using SafeERC20 for IERC20;
    IDatabase public database;

    receive() external payable {}

    constructor(IDatabase db) {
        database = db;
    }

    function disperseEther() external {
        address payable[] memory book = database.getAddressBook();
        uint8[] memory shares = database.shares();
        uint totalShares = database.totalShares();
        uint len = book.length;
        uint amount = address(this).balance / len;

        for (uint i = 0; i < len; ) {
            book[i].transfer((amount * shares[i]) / totalShares);
            ++i;
        }
    }

    function viewAddress() external view returns (address payable[] memory) {
        return database.getAddressBook();
    }

    function disperseToken(IERC20 token) external {
        address payable[] memory book = database.getAddressBook();
        uint8[] memory shares = database.shares();
        uint totalShares = database.totalShares();
        uint len = book.length;
        uint amount = token.balanceOf(address(this)) / len;

        for (uint i = 0; i < len; ) {
            token.safeTransfer(book[i], (amount * shares[i]) / totalShares);
            ++i;
        }
    }
}

